import React from 'react'
import { useContext, channelContext } from './HookUseContext';


function ComponentF() {
    return (
        <useContext.Consumer>
            {user => {
                return (
                    <channelContext.Consumer>
                        {institute =>
                            <div>
                                welcome {user}
                                <h1>Welcome to {institute}</h1>
                            </div>

                        }

                    </channelContext.Consumer>
                )
            }

            }
        </useContext.Consumer>
    )
}

export default ComponentF;
